definition.script:
pipeline {
    agent any
    stages {
        stage('Build PIC-SURE Auth HPDS') {
            steps {
                script {
                    def result = build job: 'PIC-SURE-HPDS Build', parameters: [
                        [$class: 'StringParameterValue', name: 'pipeline_build_id', value: pipeline_build_id],
                        [$class: 'StringParameterValue', name: 'git_hash', value: PSH_GIT_HASH]
                    ]
                }
            }
        }
        stage('Deploy Auth HPDS') {
            steps {
                script {
                    def result = build job: 'Deploy Auth HPDS to Existing HPDS EC2', parameters: [
                        [$class: 'StringParameterValue', name: 'target_stack', value: TARGET_STACK],
                        [$class: 'StringParameterValue', name: 'pipeline_build_id', value: pipeline_build_id],
                        [$class: 'StringParameterValue', name: 'dataset_s3_object_key', value: env.dataset_s3_object_key],
                        [$class: 'StringParameterValue', name: 'genomic_dataset_s3_object_key', value: env.genomic_dataset_s3_object_key],
                        [$class: 'BooleanParameterValue', name: 'INCLUDE_DATA', value: INCLUDE_DATA]
                    ]
                }
            }
        }
    }
}
